import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Navbar() {
  return (
    <View style={styles.navbar}>
      <View style={styles.navItems}>
        <Text style={styles.navItem}>Home</Text>
        <Text style={styles.navItem}>Men</Text>
        <Text style={styles.navItem}>Women</Text>
        <Text style={styles.navItem}>Electronics</Text>
        <Text style={styles.navItem}>Kids</Text>
        <Text style={styles.navItem}>Home-Decor</Text>
        <Text style={styles.navItem}>Profile</Text>
      </View>
      <View style={styles.gap}></View> {/* Add an empty view for spacing */}
      <View style={styles.logo}>
        <Text style={styles.logoText}>KMART</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  navbar: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: 'darkslategray',
    paddingHorizontal: 10,
    height: 60,
  },
  navItems: {
    flexDirection: 'row',
  },
  navItem: {
    color: 'white',
    marginHorizontal: 10,
    fontSize: 18,
  },
  gap: {
    flex: 1, // Flexible space to create a gap
  },
  logo: {
    backgroundColor: 'orange',
    padding: 10,
    borderRadius: 5,
  },
  logoText: {
    color: 'white',
    fontSize: 18,
  },
});
